-- ciberseguridad_realistic.sql - MySQL (realistic data)
DROP DATABASE IF EXISTS ciberseguridad;
CREATE DATABASE ciberseguridad;
USE ciberseguridad;


CREATE TABLE Rol (
  id_rol INT PRIMARY KEY AUTO_INCREMENT,
  nombre_rol VARCHAR(80),
  descripcion TEXT
);
CREATE TABLE Departamento (
  id_departamento INT PRIMARY KEY AUTO_INCREMENT,
  nombre_departamento VARCHAR(120),
  ubicacion VARCHAR(120)
);
CREATE TABLE Usuario (
  id_usuario INT PRIMARY KEY AUTO_INCREMENT,
  nombre VARCHAR(80),
  apellido VARCHAR(80),
  correo VARCHAR(150) UNIQUE,
  telefono VARCHAR(30),
  estado VARCHAR(20),
  id_rol INT,
  id_departamento INT,
  FOREIGN KEY (id_rol) REFERENCES Rol(id_rol),
  FOREIGN KEY (id_departamento) REFERENCES Departamento(id_departamento)
);
CREATE TABLE Sistema (
  id_sistema INT PRIMARY KEY AUTO_INCREMENT,
  nombre_sistema VARCHAR(200),
  descripcion TEXT,
  criticidad VARCHAR(20),
  id_responsable INT,
  FOREIGN KEY (id_responsable) REFERENCES Usuario(id_usuario)
);
CREATE TABLE Dispositivo (
  id_dispositivo INT PRIMARY KEY AUTO_INCREMENT,
  nombre_dispositivo VARCHAR(150),
  tipo VARCHAR(60),
  direccion_ip VARCHAR(50),
  sistema_operativo VARCHAR(80),
  fecha_registro DATE,
  estado VARCHAR(30),
  id_usuario INT,
  FOREIGN KEY (id_usuario) REFERENCES Usuario(id_usuario)
);
CREATE TABLE Vulnerabilidad (
  id_vulnerabilidad INT PRIMARY KEY AUTO_INCREMENT,
  tipo VARCHAR(120),
  severidad VARCHAR(20),
  descripcion TEXT,
  fecha_detectada DATE,
  fecha_resolucion DATE,
  estado VARCHAR(30),
  id_sistema INT,
  FOREIGN KEY (id_sistema) REFERENCES Sistema(id_sistema)
);
CREATE TABLE Parche (
  id_parche INT PRIMARY KEY AUTO_INCREMENT,
  descripcion TEXT,
  fecha_aplicacion DATE,
  id_vulnerabilidad INT,
  aplicado_por INT,
  FOREIGN KEY (id_vulnerabilidad) REFERENCES Vulnerabilidad(id_vulnerabilidad),
  FOREIGN KEY (aplicado_por) REFERENCES Usuario(id_usuario)
);
CREATE TABLE Incidente (
  id_incidente INT PRIMARY KEY AUTO_INCREMENT,
  tipo VARCHAR(100),
  impacto VARCHAR(30),
  severidad VARCHAR(20),
  descripcion TEXT,
  fecha_reporte DATE,
  estado VARCHAR(30),
  id_dispositivo INT,
  id_vulnerabilidad INT,
  FOREIGN KEY (id_dispositivo) REFERENCES Dispositivo(id_dispositivo),
  FOREIGN KEY (id_vulnerabilidad) REFERENCES Vulnerabilidad(id_vulnerabilidad)
);
CREATE TABLE Alerta (
  id_alerta INT PRIMARY KEY AUTO_INCREMENT,
  nivel VARCHAR(30),
  mensaje TEXT,
  fecha_hora DATETIME,
  estado VARCHAR(30),
  id_incidente INT,
  FOREIGN KEY (id_incidente) REFERENCES Incidente(id_incidente)
);
CREATE TABLE Log (
  id_log INT PRIMARY KEY AUTO_INCREMENT,
  mensaje TEXT,
  nivel VARCHAR(30),
  fecha_hora DATETIME,
  id_dispositivo INT,
  FOREIGN KEY (id_dispositivo) REFERENCES Dispositivo(id_dispositivo)
);
CREATE TABLE Politica (
  id_politica INT PRIMARY KEY AUTO_INCREMENT,
  nombre_politica VARCHAR(200),
  categoria VARCHAR(80),
  descripcion TEXT,
  fecha_implementacion DATE,
  estado VARCHAR(30)
);
CREATE TABLE Auditoria (
  id_auditoria INT PRIMARY KEY AUTO_INCREMENT,
  fecha DATE,
  resultado VARCHAR(80),
  observaciones TEXT,
  id_politica INT,
  id_sistema INT,
  auditor_responsable INT,
  FOREIGN KEY (id_politica) REFERENCES Politica(id_politica),
  FOREIGN KEY (id_sistema) REFERENCES Sistema(id_sistema),
  FOREIGN KEY (auditor_responsable) REFERENCES Usuario(id_usuario)
);

